from tkinter import filedialog

from tkinter import *
from tkinter import ttk
import tkinter as tk

from pathlib import Path

import os,subprocess

import json

from tkscrolledframe import ScrolledFrame

from os.path import expanduser

import yaml

class Console(tk.Frame):
    def __init__(self, master, width=0, height=0, **kwargs):
        self.width = '500'
        self.height = '430'
        self.master= master

        self.frame1 = ScrolledFrame(self.master, width=self.width, height=self.height)
        self.frame1.pack(side="top",fill="both", expand=1)
        self.frame1.bind_arrow_keys(self.master)
        self.frame1.bind_scroll_wheel(self.master)
        self.inner_frame=self.frame1.display_widget(Frame)

        self.host_venv=StringVar()

        self.home=expanduser("~")
        
        self.homedir=os.getcwd()
        venv_path=os.path.join('venv','bin')
        if os.path.isdir(venv_path):
            os.chdir(os.path.join(self.homedir,venv_path))
            self.host_venv.set(os.getcwd())

        self.logos ={    'cannabis':"",
            'chaingreen':"",
            'chia':"",
            'goji':"",
            'flax':"",
            'madmax':"",
            'agem':"",
            'spare': "",
            'silicoin':"",
            'flora':"",
            'hddcoin':"",
            'dogechia':"",
            'seno':"",
            'avocado':"",
            'greendoge':"",
            'taco':"",       
            'kale':"",                         
            'socks':"",
            'maize':"",
            'apple':"",         
            'melati':"",
            'tad':"",
            'cactus':"",
            'equality':"",
            'covid':"",
            'sector':"",            
            'fork':"",
            'shamrock':"",
            'chiarose':"",
            'chives':"",
            'chiadoge':""           
                         }
        self.build_menu()

    def build_menu(self):

        self.host_install_lbl=Label(self.inner_frame,text='Host Venv')
        self.detect_adv=Label(self.inner_frame,text='Detect')
        
        self.host_install_entr=Entry(self.inner_frame,textvar=self.host_venv)
       
        self.host_install_lbl.grid(row=1,column=1)
        self.host_install_entr.grid(row=1,column=2)
        
        self.find = Button(self.inner_frame,text='FIND',command=self.find)
        self.find.grid(row=1,column=3)

        self.detect_adv.grid(row=2,column=2)        
        
        self.start = Button(self.inner_frame,text='START',command=self.start)
        self.start.grid(row=2,column=3)
       

    def start(self):

        files_in_bin=os.listdir(self.host_venv.get())

        class File(object):
                def __init__(self,name,image):
                      setattr(self,'name', 'image')
                      self.name=name
                      self.image=image
                def __repr__(self):
                    return "%s"%self.__dict__
                def __exit__(self,exc_type,exc_val,exc_tb):
                    pass
        all_found_repos=[]

        self.db_files ={}
        self.config_yamls={}

        for key in self.logos.keys():
            if key in files_in_bin:
                for folder in os.listdir(self.home):
                    if '.{}'.format(key) in folder:
                        self.db_files[key]=os.path.join(self.home,folder,'mainnet','db','blockchain_v1_mainnet.sqlite')              
                        self.config_yamls[key]=os.path.join(self.home,folder,'mainnet','config','config.yaml')
                        
        print(self.config_yamls)
        self.image_vars={}

        for key in self.logos.keys():
            self.image_vars[key]=PhotoImage(data=self.logos[key])
       
        for key in self.logos.keys():
            if key in files_in_bin:
                print('%s detected'%key)
                all_found_repos.append(File(key,self.image_vars[key]))
        
                
        self.label={}
        self.label_id_text={}


        x=2
        y=0

        for lbl in all_found_repos:
                self.label[lbl.name]=Label(self.inner_frame,text=lbl.name, font=('Arial',16),compound=LEFT,image=lbl.image)
                self.label[lbl.name].grid(row=x,column=y,sticky= NW)
                self.label_id_text[id(self.label[lbl.name])]=lbl.name
                x=x+1
                try:
                    file_size='{:,.0f}'.format(os.path.getsize(self.db_files[lbl.name])/float(1<<30))+" GB"
                except:
                    file_size='no file, run init'
                    
                file_size_lbl=lbl.name+'_db'
                self.label[file_size_lbl]=Label(self.inner_frame,text='DB file size: {}'.format(file_size))
                self.label[file_size_lbl].grid(row=x,column=y,sticky= NW)
                x=x+1
                
                if lbl.name in self.config_yamls.keys():

                    try:    
                        status=subprocess.run([lbl.name,'farm','summary'],capture_output=True, shell=False)
                        output =status.stdout.decode('utf-8')
                        lst= output.split('\n')
                        stat_for_color=lst[0].split(':')[1]
                        check_stat=lst[0].split(':')[0]
                       
                        if 'Farming status' not in check_stat:
                            stat_for_color=lst[1].split(':')[1]

                        status_lbl=lbl.name+'_status'
                        if 'Syncing' in stat_for_color:
                            self.label[status_lbl]=Label(self.inner_frame,text=stat_for_color, fg='yellow')
                        elif 'Farming' in stat_for_color:
                            self.label[status_lbl]=Label(self.inner_frame,text=stat_for_color, fg='green')
                        else:
                            self.label[status_lbl]=Label(self.inner_frame,text='not available', fg='red')
                    
                        self.label[status_lbl].grid(row=x,column=y,sticky= NW)

                        x=x+1

                        plots_lbl=lbl.name+'_plots'
                        self.label[plots_lbl]=Label(self.inner_frame,text=lst[4])
                        self.label[plots_lbl].grid(row=x,column=y,sticky= NW)
                    

                        x=x+1
                    except:
                        pass
                    
                    yaml_file=self.config_yamls[lbl.name]
                    with open(yaml_file,'rb') as config:
                            data_loaded = yaml.safe_load(config)

                    self.ports= {'daemon_port':data_loaded['daemon_port'],
                        'full_node':data_loaded['full_node']['port'],
                        'full_node_rpc_port':data_loaded['full_node']['rpc_port'],
                        'harvester':data_loaded['harvester']['port'],
                        'harv_farmer_peer':data_loaded['harvester']['farmer_peer']['port'],
                        'harv_rpc_port':data_loaded['harvester']['rpc_port'],
                        'farmer':data_loaded['farmer']['port'],
                        'farm_harv_peer':data_loaded['farmer']['harvester_peer']['port'],
                        'farm_rpc_port':data_loaded['farmer']['rpc_port']
                        }

                    stdout_reply=[]

                    print( 'starting to read {} ports'.format(lbl.name))

                    for key in self.ports:
                        p=subprocess.run(['lsof','-i',':{}'.format(self.ports[key])],capture_output=True, shell=False)
                        if p.returncode ==0:
                            reply='{} : running'.format(key)
                            ports_lbl=lbl.name+'_'+key
                            self.label[ports_lbl]=Label(self.inner_frame,text=reply, fg='green')
                            self.label[ports_lbl].grid(row=x,column=y,sticky= NW)
                        if p.returncode ==1:
                            reply='{} : not running'.format(key)
                            ports_lbl=lbl.name+'_'+key
                            self.label[ports_lbl]=Label(self.inner_frame,text=reply, fg='red')
                            self.label[ports_lbl].grid(row=x,column=y,sticky= NW)
                            
                        x= x+1

                else:
                    pass

                x=x+1

                
                #if x==8:
                    #y=y+1
                    #x=2
        

    def find(self):
        self.home = str(Path.home())
        host_venv_folder=filedialog.askdirectory(parent=self.master,initialdir=self.home,
                                  title='Please select madmax dir')
        self.bin_venv=os.path.join(host_venv_folder,'venv','bin')
        if os.path.isdir(self.bin_venv):
            self.host_venv.set(self.bin_venv)


    
        
